import Link from "next/link";
import useSWR from "swr";
export default function Index() {
  const { data, error } = useSWR("./api/test.js", url =>
    fetch(url).then(r => r.text())
  );
  console.log(data);
  if (error) throw error;

  return (
    <>
      <h1>Response: {1}</h1>
      <Link href="/about">
        <a>Go to About!</a>
      </Link>
    </>
  );
}
